      this.textBox1.TabIndex = 0;
      this.textBox1.Text = "まりさ隊の安否確認・救出\r\nbio modの紹介\r\nbobs+angelsへのつなぎ（まりさの肉体復活のかぎ）\r\n生きている限り必ず戦いは必要になる\r\nまた犠牲も" +
    "必要になる\r\n取替えしのつかないことも何度もある　というか、ほぼ取り返しがつかないことだけ\r\n日本神話（いざなぎ・いざなみなどをもじる）\r\n";
