      this.textBox3.TabIndex = 2;
      this.textBox3.Text = "バイター　大陸　への不時着\r\n汚染を極小化しながらの研究\r\n準備を整えてまりさ救出へ向かう（見渡す限りのバイターの巣）\r\nようむの覚醒（ろうかんけんの使用可能）\r" +
    "\nようきの霊界からの助言\r\nバイター王（３－３－３）世界の１つの界の管理者の言霊\r\n最後の原子炉爆発";
