      this.textBox4.Name = "textBox4";
      this.textBox4.Size = new System.Drawing.Size(274, 154);
      this.textBox4.TabIndex = 3;
      this.textBox4.Text = "２－２－２の世界の要因\r\n３－３－３の世界を垣間見る\r\n栄枯盛衰　－＞　最後は増えすぎたバイターを殲滅する\r\n（バイター王からの頼み）\r\n経済のバブル？　ドル\r\n" +
    "世界・宇宙は危険にあふれている 安全を考えれば当然、進出するべきではない\r\nではなぜ、進出するのか？　－＞現世界にいても生存が脅かされるから賭けにでている\r\n";
