      this.textBox5.TabIndex = 3;
      this.textBox5.Text = "霊界と現世はつながっている\r\n　ようきの霊界からの助言\r\n不可能と思われるミッションにチャレンジ\r\n（まりさの救出）\r\n\r\n物語性がとぼしい\r\n話の筋が通っている" +
